import CRAWLER_HELPER from "../helper/crawler_helper"
import * as moment from "moment"
import * as fs from "fs"

var resultList =[];
var cnt = 0;

//replaceAll prototype 선언
String.prototype.replaceAll = function(org, dest) {
    return this.split(org).join(dest);
}

const crawler = async() => {
    var param = { url: "https://news.naver.com/main/list.nhn?mode=LS2D&mid=shm&sid1=103&sid2=248" }

    // 모든링크 공통된 사항 크롤링
    var $ = await CRAWLER_HELPER.get_response(param.url).catch(e => { console.log(e); throw e })
    
    $("tbody").find("tr").each(async function(index, item) {
        var link = $(this).find('dt.photo a').attr("href")
        if(link == undefined || link == "") { return }

        var article_id = link.split("&oid=")[1].split("&aid=")[0]

        var new_link = link
        var title = $(this).find('dt:nth-child(2) a').text()

        console.log(link);

        var fs = require('fs');
        fs.writeFile('./crawler.txt', link, function(err){
            if(err === null){
                console.log('file is opened');
                console.log(link);
            } else{
                console.log('fail');
            }
        })

        /* 저장하기
        CRAWLER_HELPER.get_response(new_link)
            .then(async result => {
                var title = result("div.articleTitle h3").text()
                var date = result("span.t11").text()                
                var content = result("div.article_body").html()

                console.log(title);
                console.log(date);
                console.log(content);

                var file = 'temp_text.txt';
                fs.open(file, 'w', function(err, fd){
                    if(err) throw err;
                    console.log('file open complete');
                });

                for(var k = 0; k < 10; k++){
                    var vvalue = liList[k].title + ' ' + liList[k].url + ' ' + liList[k].writer + ' ' + liList[k].date;
                    fs.appendFileSync('temp_text.txt', vvalue + '\n', 'utf-8', function(error){
                        console.log(k + 'error');
                    });
                }
                
            })
            .catch(e => { console.log(e); throw e })*/
    })
}

const NVR = {
    crawler
}

export default NVR

