import express from "express";

import bodyParser from "body-parser";
import { PORT } from "./config/index.js";
import router from "./src/router/router.js";
import * as HTTP from "http"
import { SSL_OP_EPHEMERAL_RSA } from "constants";
import NVR_SEO from "./src/controller/crawler/naver.js";
import DM_SEO from "./src/controller/crawler/daum.js";
import NT_SEO from "./src/controller/crawler/nate.js";



const app = express();

var http = HTTP.Server(app);

app.use(bodyParser.json());
app.use(bodyParser.urlencoded({ extended: true }));
app.use(router);

http.listen(PORT, async () => {
	console.log("START IDEA PLATFORM CRAWLER SERVER ..... ", `PORT : ${PORT}`);

	NVR_SEO.crawler();
	DM_SEO.crawler();
	NT_SEO.crawler();
	console.log("complete")
});

