import CRAWLER_HELPER from "../helper/crawler_helper"
import * as moment from "moment"
import * as fs from "fs"
import { request } from "http";
import FUNC from "./func";
import { SSL_OP_SSLEAY_080_CLIENT_DH_BUG } from "constants";
import { contents } from "cheerio/lib/api/traversing";

//replaceAll prototype 선언
String.prototype.replaceAll = function(org, dest) { return this.split(org).join(dest); }

//검색 url
let url = [
    `https://search.naver.com/search.naver?where=news&sm=tab_jum&query=`,
]

//키워드 설정
let areas = ['안동', '상주', '영천', '의성']
let disasters = ['서리', '냉해']
let crops = ['배', '사과', '복숭아', '포도']

//excel 관련
const Excel = require('exceljs');

//contents 관리
let contentsArr = [];
let articleTotalNum = [];


const crawler = async() => {
    //변수 선언
    var pageNum = 10;
    var pageNumLoop = 1;

    areas.forEach(function(area){
        disasters.forEach(function(disaster){
            crops.forEach(async function(crop){
                var articleNum = 0;
                /*
                // pageNum 받아오기
                var getPage = { url: `${url}${encodeURI(area)}+${encodeURI(disaster)}+${encodeURI(crop)}` }

                // console.log(getPage)
                var $ = await CRAWLER_HELPER.get_response(getPage.url).catch(e => { console.log(e); throw e })

                $("div.api_sc_page_wrap").find("div.sc_page").each(async function(index, item) {
                    // true : 다음 페이지 없음 / false : 다음페이지 있음
                    // console.log(2)
                    var isPageExist = $(this).find('a.btn_next').attr("aria-disabled") 

                    console.log(isPageExist)
                    if(isPageExist == 'true'){
                        pageNum = $(this).find('div .sc_page_inner a:nth-child(10)').text() 
                    }
                })
                */
                while (pageNumLoop <= pageNum) {
                     //pageNumLoop++; 밑에 추가
                    var param = { url: `${url}${encodeURI(area)}+${encodeURI(disaster)}+${encodeURI(crop)}` }
                    var $ = await CRAWLER_HELPER.get_response(param.url).catch(e => { console.log(e); throw e })
                    $("div #content").find("div #main_pack").each(async function(index, item) {
                        for(var liNum = 1; liNum <= 10; liNum++){
                            articleNum++;
                            var link = $(this).find('div ul.list_news li:nth-child('+liNum+') div.news_wrap a.news_tit').attr("href");
                            var title = $(this).find('div ul.list_news li:nth-child('+liNum+') div.news_wrap a.news_tit').text();
                            var date = $(this).find('div.info_group span.info').text();
                            //var date = FUNC.dateSet(tempDate);
                            var contents = {
                                link : `${link}`,
                                title : `${title}`,
                                date : `${date}`,
                                crop : `${crop}`,
                                area : `${area}`,
                                disaster : `${disaster}`,
                                articleNum : `${articleNum}`
                            }
                            contentsArr.push(contents);
                            console.log(contents)
                        }  
                    })
                    pageNumLoop++;
                }
                pageNumLoop = 0;
            })
        })
    })
    
    //excel 만들기
    const workbook = new Excel.Workbook();
    const worksheet = workbook.addWorksheet(`test`); 

    //excel 열 이름 설정
    worksheet.columns = [
        { header: '작물', key: '작물', width: 30 }, 
        { header: '지역', key: '지역', width: 30 }, 
        { header: '재해', key: '재해', width: 30 }, 
        { header: '기간', key: '기간', width: 30 },  
        { header: '제목', key: '제목', width: 30 }, 
        { header: '링크', key: '링크', width: 30 }
    ];
    var contentsIndex = 0;
    while(contentsIndex + 1 == contentsArr.length){
        worksheet.addRow({작물: contentsArr[contentsIndex].crop, 
                        지역: contentsArr[contentsIndex].area, 
                        재해: contentsArr[contentsIndex].disaster,
                        기간: contentsArr[contentsIndex].date,
                        제목: contentsArr[contentsIndex].title,
                        링크: contentsArr[contentsIndex].link,
                    });
        workbook.xlsx.writeFile('crawler_서리_냉해.xlsx');
    }
    
    
    /*
    //excel 만들기
    const workbook = new Excel.Workbook();
    const worksheet = workbook.addWorksheet(`작물기준`); 

    //excel 열 이름 설정
    worksheet.columns = [
        { header: '연도', key: '연도', width: 30 }, 
        { header: '배', key: '배', width: 30 }, 
        { header: '사과', key: '사과', width: 30 }, 
        { header: '복숭아', key: '복숭아', width: 30 },  
        { header: '포도', key: '포도', width: 30 }, 
    ];
    
    var contentsIndex = 0;
    while(contentsIndex + 1 == contentsArr.length()){
        if(contentsArr[contentsIndex].relatedTo == '배'){
            if(contentsArr[contentsIndex].date.getFullYear() == 2021){

            }
        }else if(contentsArr[contentsIndex].relatedTo == '사과'){

        }else if(contentsArr[contentsIndex].relatedTo == '복숭아'){

        }else if(contentsArr[contentsIndex].relatedTo == '포도'){

        }
        contentsIndex++
    }

    worksheet.addRow({title: contents.title, link: contents.link, sector: contents.sector});
    workbook.xlsx.writeFile('crawler_서리_냉해.xlsx');
    */
}
    
    


const NVR_SEO = {
    crawler
}

export default NVR_SEO

