import CRAWLER_HELPER from "../helper/crawler_helper"
import { request } from "http";
import { contents } from "cheerio/lib/api/traversing";

const Excel = require('exceljs');


//replaceAll prototype 선언
String.prototype.replaceAll = function(org, dest) {
    return this.split(org).join(dest);
}

function getToday(date){
    var year = date.getFullYear();
    var month = ("0" + (1 + date.getMonth())).slice(-2);
    var day = ("0" + date.getDate()).slice(-2);

    return year + month + day;
}

let url = `https://news.naver.com/main/list.nhn?mode=LS2D&mid=shm&sid1=103&date=`
const crawler = async() => {
    //변수 설정
    var idNum = 1;
    var searchStartDate = new Date('2021-05-26');
    var searchEndDate = new Date('2021-05-26');
    /*var contentsArr = [];
    var area = ['안동', '영천', '상주', '의성'];
    var disaster = ['서리', '냉해'];
    var areaContentsArr = [];
    var excelContents = function(area, disaster, link, title, date){
        this.area = area;
        this.disaster = disaster;
        this.link = link;
        this.title = title;
        this.date = date;
    }
    var excelContentsArr = [];
    */
    searchEndDate.setDate(searchEndDate.getDate() + 1);

    //excel 만들기
    const workbook = new Excel.Workbook();
    const worksheet = workbook.addWorksheet(`${getToday(searchStartDate)}`);
        //excel 열 이름 설정
        worksheet.columns = [
            {header: 'Id', key: 'id', width: 10},
            {header: 'Link', key: 'link', width: 30},
            {header: 'Title', key: 'title', width: 30}, 
            {header: 'Date', key: 'date', width: 15},
            //{header: 'ArticleBody', key: 'articleBody', width: 40}
        ];
    
    while(!(getToday(searchStartDate) == getToday(searchEndDate))){
        var dateForURL = getToday(searchStartDate);
        //기사 page 방문
        for(var pageNum = 1; pageNum <= 5; pageNum++){
            var param = { url: `${url}${dateForURL}&page=${pageNum}` }
            var $ = await CRAWLER_HELPER.get_response(param.url).catch(e => { console.log(e); throw e })
            
            $("tbody").find("tr").each(async function(index, item) {
                for(var ulNum = 1; ulNum <= 2; ulNum++){
                    var ulClassName
                    if(ulNum == 1){
                        ulClassName = 'type06_headline';
                    }
                    else{
                        ulClassName = 'type06';
                    }
                    for(var liNum = 1;liNum <= 10; liNum++){
                        var link = $(this).find('div ul.'+ulClassName+' li:nth-child('+liNum+') dt.photo a').attr("href")
                        if(link != undefined || link != "") { 
                            await CRAWLER_HELPER.get_response(link)
                            .then(async result => {
                                var title = result("div.article_info h3").text()
                                var date = result("div.sponsor span.t11").text()
                                //var articleBody = result("div._article_body_contents").text()

                                var contents = {
                                    idNum: `${idNum}`,
                                    link: `${link}`,
                                    title: `${title}`,
                                    date: `${date}`,
                                    //articleBody: `${articleBody}`
                                };

                                worksheet.addRow({id: idNum, link: link, title: title, date: date,}) //articleBody: articleBody
                                workbook.xlsx.writeFile('crawler_crawler_test.xlsx');
                                idNum++;
                            })
                            .catch(e => { console.log(e); })
    
                        }
                    }
                }
            })
        }
        searchStartDate.setDate(searchStartDate.getDate() + 1);
        console.log(searchStartDate)
    }
    console.log('크롤링 완료');
}

    /*지역&&재해 기사 거르기
    for(var contentsNum=0; contentsNum<contentsArr.length; contentsNum++){
        for(var areaNum=0; areaNum<area.length; areaNum++){
            for(var disasterNum=0; disasterNum<disaster.length; disaster++)
            if(contentsArr[contentsNum].title.includes(area[areaNum]&&disaster[disasterNum])){
                var contents = new excelContents(area[areaNum], disaster[disasterNum], contentsArr);
                excelContentsArr.push(contents);
                delete contentsArr[contentsNum];
            }
            delete contentsArr[contentsNum];
        }
    }
    console.log(excelContentsArr);

    //작물별 기사 거르기
    
    
    //워크시트 지역별 분리
    const workbook = new Excel.Workbook();
    for(areaNum=1; areaNum<area.length; areaNum++){
        const worksheet = workbook.addWorksheet(area[areaNum]);
        //excel 열 이름 설정
        worksheet.columns = [
            {header: '배', key: '배', width: 10},
            {header: '사과', key: '사과', width: 30},
            {header: '복숭아', key: '복숭아', width: 30}, 
            {header: '포도', key: '포도', width: 15},
            {header: '자두', key: '자두', width: 15},
            {header: '감', key: '감', width: 15},
            {header: '합계', key: '합계', width: 15}
            
        ];

        worksheet.addRow({배: 1, 사과: 123, 복숭아: 1234, 포도: 12345, 자두: 123456, 감: 1234567, 합계: aaa })
        workbook.xlsx.writeFile('crawler_test.xlsx');
    }
        


    }
    */


const AAA = {
    crawler
}

export default AAA

