import CRAWLER_HELPER from "../helper/crawler_helper"
import * as moment from "moment"
import * as fs from "fs"
import { request } from "http";
import FUNC from "./function";

//replaceAll prototype 선언
String.prototype.replaceAll = function(org, dest) { return this.split(org).join(dest); }

let url = [
    `https://news.naver.com/main/list.nhn?mode=LSD&mid=shm&sid1=103&date=`,
    `https://news.naver.com/main/list.nhn?mode=LSD&mid=shm&sid1=102&date=`,
    `https://news.naver.com/main/list.nhn?mode=LSD&mid=sec&sid1=001&date=`
]

const Excel = require('exceljs');

let startDate = '2021-03-01'
let endDate = '2021-04-25'
let page = 100

const crawler = async() => {
    //excel 만들기
    const workbook = new Excel.Workbook();

    //변수 설정
    var searchStartDate = new Date(startDate);
    var originStartDate = searchStartDate;
    var searchEndDate = new Date(endDate);
    searchEndDate.setDate(searchEndDate.getDate() + 1);

    var urlNum = 0;

    while(urlNum < url.length) {

        const worksheet = workbook.addWorksheet(`${FUNC.getToday(searchStartDate)}`);
        //excel 열 이름 설정
        worksheet.columns = [
            { header: 'Title', key: 'title', width: 30 },  
            { header: 'Link', key: 'link', width: 30 },
            { header: 'sector', key: 'sector', width: 30 },
        ];

        var dateForURL = FUNC.getToday(searchStartDate);
        //기사 page 방문
        for(var pageNum = 1; pageNum <= page; pageNum++) {
            var param = { url: `${url[urlNum]}${dateForURL}&page=${pageNum}` }

            // console.log(param)
            var $ = await CRAWLER_HELPER.get_response(param.url).catch(e => { console.log(e); throw e })

            $("tbody").find("tr").each(async function(index, item) {
                for(var ulNum = 1; ulNum <= 2; ulNum++){
                    var ulClassName
                    if(ulNum == 1) { ulClassName = 'type06_headline'; }
                    else{ ulClassName = 'type06'; }

                    for(var liNum = 1; liNum <= 3; liNum++){
                        var link = $(this).find('div ul.'+ulClassName+' li:nth-child('+liNum+') dt:nth-child(2) a').attr("href")
                        var contents = await CRAWLER_HELPER.get_response(link).then(result => FUNC.areaAndDisaster(link, result, param))

                        if(contents != null) {
                            console.log(contents)
                            worksheet.addRow({title: contents.title, link: contents.link, sector: contents.sector});
                            workbook.xlsx.writeFile('crawler_expansion.xlsx');
                        }
                    }
                }
            })
        }


        searchStartDate.setDate(searchStartDate.getDate() + 1);
        console.log(searchStartDate)

        if(FUNC.getToday(searchStartDate) == FUNC.getToday(searchEndDate)){
            console.log('한 면 완료')
            urlNum++;
            searchStartDate.setDate(originStartDate.getDate());
        }
    }
    
    console.log('크롤링이 완료되었습니다.')
}

const NVR_EX = {
    crawler
}

export default NVR_EX

