    if(date.charAt(2) == '분' || date.charAt(3) == '분'){
        var temp = date.split('분')
        var minutes = parseInt(temp[0])
        var presentTime = new Date();
        var date = new Date();
        date.setMinutes(presentTime.getMinutes()-minutes);
        return date;
    }else if(date.charAt(2) == '시간' || date.charAt(3) == '시간'){
        var temp = date.split('시간')
        var hours = parseInt(temp[0])
