        date.setHours(presentTime.getHours()-hours);
        return date;
    }else if(date.charAt(2) == '일' || date.charAt(3) == '일'){
        var temp = date.split('일')
        var dates = parseInt(temp[0])
        var presentTime = new Date();
        var date = new Date();
        date.setDate(presentTime.getDate()-dates);
        return date;
    }else{
        return date;
    }

    console.log('func.js의 dateSet Function 오류');
    return;
}

const FUNC = {
    dateSet
}

export default FUNC

