import CRAWLER_HELPER from "../helper/crawler_helper"
import * as fs from "fs"
import { request } from "http";
import { SSL_OP_SSLEAY_080_CLIENT_DH_BUG } from "constants";
import { contents } from "cheerio/lib/api/traversing";

//replaceAll prototype 선언
String.prototype.replaceAll = function(org, dest) { return this.split(org).join(dest); }

//검색 url
let url = [
    `https://search.daum.net/search?w=news&nil_search=btn&DA=NTB&enc=utf8&cluster=y&cluster_page`,
]

//키워드 설정

let areas = ['안동', '상주', '영천', '의성']
let disasters = ['서리', '냉해']
let crops = ['배', '사과', '복숭아', '포도']

//excel 관련
const Excel = require('exceljs');
var moment = require('moment');


//변수 선언
var pageNum = 10;
var pageNumLoop = 1;

const crawler = async () => {
    
    makeContentes();
    
}

/*const dataSorting = async (workbook) => {
    const worksheet = workbook.addWorksheet('작물별 기사 수');
    worksheet.addTable({
        name : '작물별 기사 수',
        ref: 'A1',
        headerRow: true,
        totalsRow : true,
        columns: [
        ]
    })
}*/

const makeContentes = async () => {
    console.log("daum")
    const workbook = new Excel.Workbook();

    const worksheet = workbook.addWorksheet('전체 기사');

    worksheet.columns = [
        { header: '연도', key: 'year', width: 30 }, 
        { header: '날짜', key: 'date', width: 30 },  
        { header: '작물', key: 'crop', width: 30 },  
        { header: '지역', key: 'area', width: 30 }, 
        { header: '재해', key: 'disaster', width: 30 },
        { header: '제목', key: 'title', width: 30 }, 
        { header: '링크', key: 'link', width: 30 }, 
    ];

    areas.forEach(function(area) {
        disasters.forEach(async function(disaster) {
            crops.forEach(async function(crop) {
                while (pageNumLoop <= pageNum) {
                    var param = { url: `${url}${pageNumLoop > 1 ? (pageNum * pageNumLoop) + 1 : 0}&q=${encodeURI(area)}+${encodeURI(disaster)}+${encodeURI(crop)}` }
                    var $ = await CRAWLER_HELPER.get_response(param.url).catch(e => { console.log(e); throw e })

                    $("div .inner_article").find("div #newsColl").each(async function(index, item) {
                        for(var liNum = 1; liNum <= 10; liNum++) {
                            var link = $(this).find('div ul.clusterResultUL li:nth-child('+liNum+') div.wrap_tit a.f_link_b').attr("href");
                            var title = $(this).find('div ul.clusterResultUL li:nth-child('+liNum+') div.wrap_tit a.f_link_b').text();
                            var date = $(this).find('div ul.clusterResultUL li:nth-child('+liNum+') div.wrap_tit span.f_nb date').text();
                            var year = date.split('.')[0];

                            var contents = {
                                link : `${link}`,
                                title : `${title}`,
                                date : `${date}`,
                                year : `${year}`,
                                crop : `${crop}`,
                                area : `${area}`,
                                disaster : `${disaster}`
                            }

                            worksheet.addRow({
                                year: contents.year,
                                date: contents.date, 
                                crop: contents.crop,
                                area: contents.area,
                                disaster: contents.disaster,
                                title: contents.title,
                                link: contents.link
                            });

                            workbook.xlsx.writeFile(`${moment().add(-1, 'day').format('YYYYMMDD')}_daum.xlsx`);
                        }
                    })
                    pageNumLoop++;
                }
                pageNumLoop = 1
            })
        })
    })
}

const DM_SEO = {
    crawler
}

export default DM_SEO

