import CRAWLER_HELPER from "../helper/crawler_helper"
import * as fs from "fs"
import { request } from "http";
import { SSL_OP_SSLEAY_080_CLIENT_DH_BUG } from "constants";
import { contents } from "cheerio/lib/api/traversing";

//replaceAll prototype 선언
String.prototype.replaceAll = function(org, dest) { return this.split(org).join(dest); }

//검색 url
let url = [
    `https://news.nate.com/search?q=`,
]

//키워드 설정

let areas = ['안동', '상주', '영천', '의성']
let disasters = ['서리', '냉해']
let crops = ['배', '사과', '복숭아', '포도']

//excel 관련
const Excel = require('exceljs');
var moment = require('moment');


//변수 선언
var pageNum = 10;
var pageNumLoop = 1;

const crawler = async () => {
    
    makeContentes();
    
}

const makeContentes = async () => {
    console.log("nate")
    const workbook = new Excel.Workbook();

    const worksheet = workbook.addWorksheet('전체 기사');

    worksheet.columns = [
        { header: '연도', key: 'year', width: 30 }, 
        { header: '날짜', key: 'date', width: 30 },  
        { header: '작물', key: 'crop', width: 30 },  
        { header: '지역', key: 'area', width: 30 }, 
        { header: '재해', key: 'disaster', width: 30 },
        { header: '제목', key: 'title', width: 30 }, 
        { header: '링크', key: 'link', width: 30 }, 
    ];

    areas.forEach(function(area) {
        disasters.forEach(async function(disaster) {
            crops.forEach(async function(crop) {
                while (pageNumLoop <= pageNum) {
                    var param = { url: `${url}${encodeURI(area)}+${encodeURI(disaster)}+${encodeURI(crop)}&page=${pageNumLoop > 1 ? (pageNum * pageNumLoop) + 1 : 0}` }
                    var $ = await CRAWLER_HELPER.get_response(param.url).catch(e => { console.log(e); throw e })

                    $("div #newsContents").find("div .search-option").each(async function(index, item) {
                        for(var liNum = 1; liNum <= 15; liNum++) {
                            var link = $(this).find('div ul.search-list li:nth-child('+liNum+') a.info').attr("href");
                            var title = $(this).find('div ul.search-list li:nth-child('+liNum+') a.info span.tit').text();
                            var tempDate = $(this).find('div ul.search-list li:nth-child('+liNum+') span.time').text();
                            var date = tempDate.split('2')[1];
                            var year = date.split('.')[0];

                            var contents = {
                                link : `${link}`,
                                title : `${title}`,
                                date : `${date}`,
                                year : `${year}`,
                                crop : `${crop}`,
                                area : `${area}`,
                                disaster : `${disaster}`
                            }

                            worksheet.addRow({
                                year: contents.year,
                                date: contents.date, 
                                crop: contents.crop,
                                area: contents.area,
                                disaster: contents.disaster,
                                title: contents.title,
                                link: contents.link
                            });

                            workbook.xlsx.writeFile(`${moment().add(-1, 'day').format('YYYYMMDD')}_nate.xlsx`);
                        }
                    })
                    pageNumLoop++;
                }
                pageNumLoop = 1
            })
        })
